    set str=REPLACE(str,'[','');
    set str=REPLACE(str,']','');
    set str=REPLACE(str,'{','');
    set str=REPLACE(str,'}','');
    set str=REPLACE(str,'\n','');
    RETURN str;
END ;;
DELIMITER ;
