CREATE DEFINER=`root`@`%` PROCEDURE `sp_CambiaEstatusSolicitud`(
	IN `P_IdUsuario` CHAR(36),
	IN `P_IdSolicitud` CHAR(36),
	IN `P_Estatus` TINYINT,
	IN `P_Contrasena` VARCHAR(255),
	IN `P_TipoSol` VARCHAR(100),
	IN `P_EsAdmin` TINYINT,
	IN `P_PuedeFirmar` TINYINT
)
proc : BEGIN
	DECLARE
	EXIT HANDLER FOR SQLEXCEPTION BEGIN
			ROLLBACK;-- rollback any error in the transaction
		
	END;-- Obtener el nombre del tipo de usuario
	
	SET @TpoUser = (
		SELECT
			UPPER ( t.Nombre ) 
		FROM
			TiCentral.TipoUsuario t
			INNER JOIN TiCentral.Usuarios u ON t.Id = u.IdTipoUsuario 
		WHERE
			u.Id = P_IdUsuario 
		);-- Obtener si el usuario tiene acceso a la app que se registro en la solicitud
	
	SET @App = ( SELECT IdApp FROM TiCentral.Solicitudes WHERE id = P_IdSolicitud );
	
	SET @Tiene = ( SELECT COUNT( id ) FROM TiCentral.UsuarioAplicacion WHERE idusuario = P_IdUsuario AND idapp = @App );-- obtenemos el tipo de solicitud que se esta enviando
	
	SET @TipoSol = (
		SELECT
			id 
		FROM
			TipoSolicitud s 
		WHERE
		UPPER( s.tipoSoli ) = UPPER( P_TipoSol ));-- esto es cuando se va a activar un usuario
	IF
		( @TpoUser = 'ADMINGENERAL' ) 
		OR ( @TpoUser = 'ADMINPLATAFORMA' AND @Tiene >= 1 ) THEN-- ACCIONES DE ALTA
		IF
			( UCASE ( P_TipoSol ) = 'ALTA' ) THEN
			
			IF
				( P_Estatus = 1 ) THEN
				IF
					( P_EsAdmin = 1 ) THEN
						
						SET @P_IdTipoUsuario = (
						SELECT
							Id 
						FROM
							TiCentral.TipoUsuario 
						WHERE
						UCASE( Nombre )= UCASE( 'AdminPlataforma' ));
					ELSE 
						SET @P_IdTipoUsuario = ( SELECT Id FROM TiCentral.TipoUsuario WHERE UCASE( Nombre )= 'USER' );
					
				END IF;
				SELECT
					Id,
					Nombre,
					ApellidoPaterno,
					ApellidoMaterno,
					NombreUsuario,
					CorreoElectronico,
					Puesto,
					Curp,
					Rfc,
					Telefono,
					Ext,
					Celular,
					s.IdApp,
					s.Roles,
					s.IdEntidad,
					s.IdTipoUsuario,
					s.PuedeFirmar INTO @Id,
					@Nombre,
					@ApellidoPaterno,
					@ApellidoMaterno,
					@NombreUsuario,
					@CorreoElectronico,
					@Puesto,
					@Curp,
					@Rfc,
					@Telefono,
					@Ext,
					@Celular,
					@IdApp,
					@Roles,
					@IdEntidad,
					@IdTipoUsuario,
					@PuedeFirmar 
				FROM
					TiCentral.Solicitudes s 
				WHERE
					Id = P_IdSolicitud;
				START TRANSACTION;
				INSERT INTO TiCentral.Usuarios (
					Id,
					Nombre,
					ApellidoPaterno,
					ApellidoMaterno,
					NombreUsuario,
					CorreoElectronico,
					Puesto,
					Curp,
					Rfc,
					Telefono,
					Ext,
					Celular,
					IdTipoUsuario,
					CreadoPor,
					ModificadoPor,
					Contrasena,
					EstaActivo,
					PuedeFirmar 
				)
				VALUES
					(
						@Id,
						@Nombre,
						@ApellidoPaterno,
						@ApellidoMaterno,
						@NombreUsuario,
						@CorreoElectronico,
						@Puesto,
						@Curp,
						@Rfc,
						@Telefono,
						@Ext,
						@Celular,
						@IdTipoUsuario,
						P_IdUsuario,
						P_IdUsuario,
						P_Contrasena,
						1,
						@PuedeFirmar 
					);
				IF
					ROW_COUNT() = 0 THEN
					SELECT
						'500' AS Respuesta,
						'Error al guardar el usuario' AS Mensaje;
					ROLLBACK;
					
				END IF;
				INSERT INTO TiCentral.UsuarioAplicacion ( IdUsuario, IdApp, IdEntidad )
				VALUES
					( P_IdSolicitud, @IdApp, @IdEntidad );
				IF
					ROW_COUNT() = 0 THEN
						ROLLBACK;
					SELECT
						'500' AS Respuesta,
						'Error al guardar el usuario' AS Mensaje;
					LEAVE proc;
					
				END IF;-- iterar los roles y perfiles
#region insert roles
				
				SET @ContadorRoles = 0;
				
				SET @LonguitudRoles = JSON_LENGTH(
				JSON_EXTRACT( @Roles, '$.Roles' ));
				WHILE
						@ContadorRoles < @LonguitudRoles DO
						
						SET @IdRol = JSON_EXTRACT(
							@Roles,
						CONCAT( '$.Roles[', @ContadorRoles, ']' ));
					
					SET @ContadorRoles = @ContadorRoles + 1;
					INSERT INTO TiCentral.UsuarioRol ( IdUsuario, IdRol, IdApp )
					VALUES
						( P_IdSolicitud, JSON_UNQUOTE( @IdRol ), @IdApp );
					IF
						ROW_COUNT() = 0 THEN
							ROLLBACK;
						SELECT
							'500' AS Respuesta,
							'Error al guardar los roles' AS Mensaje;
						LEAVE proc;
						
					END IF;
					
				END WHILE;#endregion
				UPDATE TiCentral.Solicitudes s 
				SET s.Estatus = 1,
				s.UltimaModificacion = CURRENT_TIMESTAMP (),
				s.ModificadoPor = P_IdUsuario 
				WHERE
					Id = P_IdSolicitud;
				IF
					ROW_COUNT() = 0 THEN
						ROLLBACK;
					SELECT
						'500' AS Respuesta,
						'Error al actualizar el estado de la solicitud' AS Mensaje;
					LEAVE proc;
					
				END IF;
				COMMIT;
				SELECT
					'201' AS Respuesta,
					'Solicitud aprobada con éxito' AS Mensaje;
				
			END IF;
			IF
				( P_Estatus = 2 ) THEN
					UPDATE TiCentral.Solicitudes 
					SET Estatus = 2,
					UltimaModificacion = CURRENT_TIMESTAMP (),
					ModificadoPor = P_IdUsuario 
				WHERE
					Id = P_IdSolicitud;
				SELECT
					'201' AS Respuesta,
					'Solicitud rechazada con éxito' AS Mensaje;
				
			END IF;
			IF
				( P_Estatus = 3 ) THEN
					UPDATE TiCentral.Solicitudes 
					SET Estatus = 3,
					UltimaModificacion = CURRENT_TIMESTAMP (),
					ModificadoPor = P_IdUsuario 
				WHERE
					Id = P_IdSolicitud;
				SELECT
					'201' AS Respuesta,
					'Se solicito una modificación con éxito' AS Mensaje;
				
			END IF;
			
		END IF;#endregion Alta
		IF
			( UCASE ( P_TipoSol ) = 'BAJA' ) THEN#region baja
			IF
				( P_Estatus = 1 ) THEN
					START TRANSACTION;
				
				SET @IdApp = ( SELECT IdApp FROM TiCentral.Solicitudes WHERE Id = P_IdSolicitud );
				SELECT s.CorreoElectronico,s.NombreUsuario INTO @Correo, @UserName FROM TiCentral.Solicitudes s WHERE Id = P_IdSolicitud; 
				SET @IdUser = (
					SELECT
						Id 
					FROM
						TiCentral.Usuarios u
					WHERE
					u.CorreoElectronico = @Correo AND u.NombreUsuario=@UserName);
				DELETE 
				FROM
					TiCentral.UsuarioAplicacion 
				WHERE
					IdUsuario = @IdUser 
					AND IdApp = @IdApp;
				DELETE 
				FROM
					TiCentral.UsuarioRol 
				WHERE
					IdUsuario = @IdUser 
					AND IdApp = @IdApp;
				UPDATE TiCentral.Solicitudes s 
				SET s.Estatus = 1,
				s.UltimaModificacion = CURRENT_TIMESTAMP (),
				s.ModificadoPor = P_IdUsuario 
				WHERE
					Id = P_IdSolicitud;
				IF
					ROW_COUNT() = 0 THEN
						ROLLBACK;
					SELECT
						'500' AS Respuesta,
						'Error al actualizar Roles 3' AS Mensaje;
					LEAVE proc;
					
				END IF;
				IF
					( SELECT COUNT(*) FROM TiCentral.UsuarioAplicacion WHERE IdUsuario = @IdUser )= 0 THEN
						UPDATE TiCentral.Usuarios u 
						SET u.EstaActivo = 0,
						u.UltimaModificacion = CURRENT_TIMESTAMP (),
						u.ModificadoPor = P_IdUsuario 
					WHERE
						u.Id = @IdUser;
					IF
						ROW_COUNT() = 0 THEN
							ROLLBACK;
						SELECT
							'500' AS Respuesta,
							'Error al actualizar Roles 3' AS Mensaje;
						LEAVE proc;
						
					END IF;
					SELECT
						'201' AS Respuesta,
						'Solicitud aprobada con éxito' AS Mensaje;
					
				END IF;
				COMMIT;
				
			END IF;
			IF
				( P_Estatus = 2 ) THEN
					UPDATE TiCentral.Solicitudes 
					SET Estatus = 2,
					UltimaModificacion = CURRENT_TIMESTAMP (),
					ModificadoPor = P_IdUsuario 
				WHERE
					Id = P_IdSolicitud;
				SELECT
					'201' AS Respuesta,
					'Solicitud rechazada con éxito' AS Mensaje;
				
			END IF;
			
		END IF;#endregion Baja
-- ACCIONES DE MODIFICACION
		IF
			( UCASE ( P_TipoSol ) = 'MODIFICACION' ) THEN#region modificar
			IF
				( P_Estatus = 1 ) THEN
					
				SELECT s.CorreoElectronico,s.NombreUsuario INTO @Correo, @UserName FROM TiCentral.Solicitudes s WHERE Id = P_IdSolicitud; 
				SET @IdUser = (
					SELECT
						Id 
					FROM
						TiCentral.Usuarios u
					WHERE
					u.CorreoElectronico = @Correo AND u.NombreUsuario=@UserName);
				SELECT
					Id,
					Nombre,
					ApellidoPaterno,
					ApellidoMaterno,
					NombreUsuario,
					CorreoElectronico,
					Puesto,
					Curp,
					Rfc,
					Telefono,
					Ext,
					Celular,
					s.IdApp,
					s.Roles,
					s.IdEntidad,
					s.IdTipoUsuario,
					s.PuedeFirmar INTO @Id,
					@Nombre,
					@ApellidoPaterno,
					@ApellidoMaterno,
					@NombreUsuario,
					@CorreoElectronico,
					@Puesto,
					@Curp,
					@Rfc,
					@Telefono,
					@Ext,
					@Celular,
					@IdApp,
					@Roles,
					@IdEntidad,
					@IdTipoUsuario,
					@PuedeFirmar 
				FROM
					TiCentral.Solicitudes s 
				WHERE
					Id = P_IdSolicitud;
				START TRANSACTION;-- Actualizar  los datos del usuario
				UPDATE TiCentral.Usuarios u 
				SET u.Nombre = @Nombre,
				u.ApellidoPaterno = @ApellidoPaterno,
				u.ApellidoMaterno = @ApellidoMaterno,
				u.Puesto = @Puesto,
				u.Curp = @Curp,
				u.Rfc = @Rfc,
				u.Telefono = @Telefono,
				u.Ext = @Ext,
				u.Celular = @Celular,
				u.IdTipoUsuario = @IdTipoUsuario,
				u.PuedeFirmar = @PuedeFirmar,
				u.UltimaModificacion = CURRENT_TIMESTAMP (),
				u.ModificadoPor = P_IdUsuario 
				WHERE
					u.Id = @IdUser;
				IF
					ROW_COUNT() = 0 THEN
						ROLLBACK;
					SELECT
						'500' AS Respuesta,
						'Error al guardar los datos del usuario 1' AS Mensaje,
						@IdUser,@Correo, @UserName;
					LEAVE proc;
					
				END IF;-- Actualizar usuarioAplicacion
				UPDATE TiCentral.UsuarioAplicacion ua 
				SET
				ua.IdEntidad = @IdEntidad 
				WHERE
					ua.IdUsuario = @IdUser 
					AND ua.IdApp = @IdApp;-- Eliminar roles y perfiles
				DELETE 
				FROM
					TiCentral.UsuarioRol 
				WHERE
					IdUsuario = @IdUser 
					AND IdApp = @IdApp;
			
#region insert roles
				
				SET @ContadorRoles = 0;
				
				SET @LonguitudRoles = JSON_LENGTH(
				JSON_EXTRACT( @Roles, '$.Roles' ));
				WHILE
						@ContadorRoles < @LonguitudRoles DO
						
						SET @IdRol = JSON_EXTRACT(
							@Roles,
						CONCAT( '$.Roles[', @ContadorRoles, ']' ));
					
					SET @ContadorRoles = @ContadorRoles + 1;
					INSERT INTO TiCentral.UsuarioRol ( IdUsuario, IdRol, IdApp )
					VALUES
						( @IdUser, JSON_UNQUOTE( @IdRol ), @IdApp );
					IF
						ROW_COUNT() = 0 THEN
							ROLLBACK;
						SELECT
							'500' AS Respuesta,
							'Error al guardar los roles' AS Mensaje;
						LEAVE proc;
						
					END IF;
					
				END WHILE;#endregion
				UPDATE TiCentral.Solicitudes s 
				SET s.Estatus = 1,
				s.UltimaModificacion = CURRENT_TIMESTAMP (),
				s.ModificadoPor = P_IdUsuario 
				WHERE
					Id = P_IdSolicitud;
				IF
					ROW_COUNT() = 0 THEN
						ROLLBACK;
					SELECT
						'500' AS Respuesta,
						'Error Modificar la solicitud' AS Mensaje;
					LEAVE proc;
					
				END IF;
				SELECT
					'201' AS Respuesta,
					'Se modifico el tipo de solicitud a modificacion' AS Mensaje;
				COMMIT;
				
			END IF;
			IF
				( P_Estatus = 2 ) THEN-- Pendiente
					UPDATE TiCentral.Solicitudes s 
					SET s.Estatus = 2,
					s.UltimaModificacion = CURRENT_TIMESTAMP (),
					s.ModificadoPor = P_IdUsuario 
				WHERE
					Id = P_IdSolicitud;
				SELECT
					'201' AS Respuesta,
					'Se rechazo la modificación' AS Mensaje;
				
			END IF;
			IF
				( P_Estatus = 3 ) THEN-- Pendiente
					UPDATE TiCentral.Solicitudes s 
					SET s.Estatus = 3,
					s.UltimaModificacion = CURRENT_TIMESTAMP (),
					s.ModificadoPor = P_IdUsuario 
				WHERE
					Id = P_IdSolicitud;
				SELECT
					'201' AS Respuesta,
					'Se solicito  una modificación' AS Mensaje;
				
			END IF;
			
		END IF;#endregion modificar
-- ACCIONES DE VINCULACION
		IF
			( UCASE ( P_TipoSol ) = 'VINCULACION' ) THEN#region Vinculacion
			IF
				( P_Estatus = 1 ) THEN
					
					SELECT s.CorreoElectronico,s.NombreUsuario INTO @Correo, @UserName FROM TiCentral.Solicitudes s WHERE Id = P_IdSolicitud; 
				SET @IdUser = (
					SELECT
						Id 
					FROM
						TiCentral.Usuarios u
					WHERE
					u.CorreoElectronico = @Correo AND u.NombreUsuario=@UserName);
				SELECT
					s.IdApp,
					s.Roles,
					s.IdEntidad INTO @IdApp,
					@Roles,
					@IdEntidad 
				FROM
					TiCentral.Solicitudes s 
				WHERE
					Id = P_IdSolicitud;
				INSERT INTO TiCentral.UsuarioAplicacion ( IdUsuario, IdApp, IdEntidad )
				VALUES
					( @IdUser, @IdApp, @IdEntidad );
				IF
					ROW_COUNT() = 0 THEN
						ROLLBACK;
					SELECT
						'500' AS Respuesta,
						'Error al guardar el usuario' AS Mensaje;
					LEAVE proc;
					
				END IF;-- iterar los roles y perfiles
#region insert roles
				
				SET @ContadorRoles = 0;
				
				SET @LonguitudRoles = JSON_LENGTH(
				JSON_EXTRACT( @Roles, '$.Roles' ));
				WHILE
						@ContadorRoles < @LonguitudRoles DO
						
						SET @IdRol = JSON_EXTRACT(
							@Roles,
						CONCAT( '$.Roles[', @ContadorRoles, ']' ));
					
					SET @ContadorRoles = @ContadorRoles + 1;
					INSERT INTO TiCentral.UsuarioRol ( IdUsuario, IdRol, IdApp )
					VALUES
						( @IdUser, JSON_UNQUOTE( @IdRol ), @IdApp );
					IF
						ROW_COUNT() = 0 THEN
							ROLLBACK;
						SELECT
							'500' AS Respuesta,
							'Error al guardar los roles' AS Mensaje;
						LEAVE proc;
						
					END IF;
					
				END WHILE;
-- #endregion
-- -----------------------------------------------------
				UPDATE TiCentral.Solicitudes s 
				SET s.Estatus = 1,
				s.UltimaModificacion = CURRENT_TIMESTAMP (),
				s.ModificadoPor = P_IdUsuario 
				WHERE
					Id = P_IdSolicitud;
				SELECT
					'201' AS Respuesta,
					'Vinculación aprobada con éxito' AS Mensaje;
				
			END IF;
			IF
				( P_Estatus = 2 ) THEN
					UPDATE TiCentral.Solicitudes s 
					SET s.Estatus = 2,
					s.UltimaModificacion = CURRENT_TIMESTAMP (),
					s.ModificadoPor = P_IdUsuario 
				WHERE
					Id = P_IdSolicitud;
				SELECT
					'201' AS Respuesta,
					'Vinculación denagada' AS Mensaje;
				
			END IF;
			
		END IF;
		ELSE SELECT
			'403' AS Respuesta,
			'Usuario no tiene permiso para aprobar solicitud' AS Mensaje;#endregion vincular
		
	END IF;

END ;;
DELIMITER ;
