CREATE DEFINER=`root`@`%` PROCEDURE `sp_CrearApp`(
	IN `P_Nombre` VARCHAR(500),
	IN `P_Descripcion` VARCHAR(500),
	IN `P_Path` VARCHAR(30),
	IN `P_IdUsuario` CHAR(36)
)
BEGIN

	DECLARE Respuesta INT;
    

		INSERT INTO Apps (
		Nombre,
		Descripcion,
		Path,
		EstaActivo,
		CreadoPor,
		FechaDeCreacion,
		UltimaModificacion,
		ModificadoPor
		)VALUES(
		P_Nombre,
		P_Descripcion,
		P_Path,
		1,
		P_IdUsuario,
		CURRENT_TIMESTAMP(),
		CURRENT_TIMESTAMP(),
		P_IdUsuario
		);

		SET Respuesta = 201;
		SELECT (select Id FROM Apps WHERE Nombre = P_Nombre AND Path = P_Path), Respuesta,'Se creo la aplicación con éxito' AS Mensaje;
        




END ;;
