CREATE DEFINER=`root`@`%` PROCEDURE `sp_CrearEntidad`(
	IN `P_Nombre` VARCHAR(200),
	IN `P_Direccion` LONGTEXT,
	IN `P_Telefono` VARCHAR(10),
	IN `P_IdTipoEntidad` CHAR(36),
	IN `P_IdTitular` CHAR(36),
	IN `P_PerteneceA` CHAR(36),
	IN `P_ControlInterno` VARCHAR(50),
	IN `P_ClaveSiregob` VARCHAR(20),
	IN `P_IdUsuario` CHAR(36)
)
BEGIN
    
	IF ((SELECT COUNT(*) FROM Entidades WHERE Nombre = P_Nombre AND Deleted = 0) = 0 ) THEN
	
	INSERT INTO Entidades (
		Nombre,
		Direccion,
		Telefono,
		IdTipoEntidad,
		IdTitular,
		PerteneceA,
		ControlInterno,
		ClaveSiregob,
		FechaCreacion,
		CreadoPor,
		UltimaActualizacion,
		ModificadoPor
		)VALUES(
		P_Nombre,
		P_Direccion,
		P_Telefono,
		P_IdTipoEntidad,
		P_IdTitular,
		P_PerteneceA,
		P_ControlInterno,
		P_ClaveSiregob,
		CURRENT_TIMESTAMP(),
		P_IdUsuario,
		CURRENT_TIMESTAMP(),
		P_IdUsuario
		);
		
		SELECT 
			Id, 
			Nombre,
			Direccion,
			Telefono,
			IdTipoEntidad,
			IdTitular,
			PerteneceA,
			ControlInterno,
			ClaveSiregob, 
			201 AS Respuesta, 
			'Se creo la aplicación con éxito' AS Mensaje 
		FROM Entidades 
		WHERE Nombre = P_Nombre;
		
	ELSE
	
	SELECT 'Entidad ya existente' AS ERROR;
		
END IF;



END ;;
