CREATE DEFINER=`root`@`%` PROCEDURE `sp_CrearTipoEntidad`(
	IN `P_Nombre` VARCHAR(200),
	IN `P_Descripcion` LONGTEXT,
	IN `P_IdUsuario` CHAR(36)
)
BEGIN

IF ((SELECT COUNT(*) FROM TipoEntidades WHERE Nombre = P_Nombre AND Deleted = 0) = 0 ) THEN

	INSERT INTO TipoEntidades(Nombre, Descripcion, CreadoPor, FechaCreacion, ModificadoPor, UltimaActualizacion)
	VALUES (P_Nombre, P_Descripcion, P_IdUsuario, NOW(), P_IdUsuario, NOW());
	
	SELECT Id, Nombre, Descripcion FROM TipoEntidades WHERE Nombre = P_Nombre;
	
ELSE

 SELECT 'Tipo entidad ya existente' AS ERROR;
 
END IF;

END ;;
