CREATE DEFINER=`root`@`%` PROCEDURE `sp_dependencia`(
	IN `P_DEPENDENCIA` CHAR(36)
)
BEGIN
  

    -- Crear una tabla temporal para almacenar los resultados
    CREATE TEMPORARY TABLE TempTabla (
        id VARCHAR(36),
        Nombre VARCHAR(255),
        Descripcion VARCHAR(255),
        PerteneceA VARCHAR(36)
    );

     SET @id=P_DEPENDENCIA;
     SET @ingresar=TRUE;
    WHILE @ingresar DO
      
      
        SELECT 
          COUNT(1) INTO  @dependecias
        FROM TiCentral.Dependencias dep
        INNER JOIN TiCentral.TipoDependencias td ON dep.IdTipoDependencia = td.Id
        WHERE dep.id=@id;
        
        if @dependecias >0 then
        
        INSERT INTO TempTabla
        SELECT 
            dep.id,
            dep.Nombre,
            td.Descripcion,
            dep.PerteneceA
        FROM TiCentral.Dependencias dep
        INNER JOIN TiCentral.TipoDependencias td ON dep.IdTipoDependencia = td.Id
        WHERE dep.id=@id;
        
        SELECT PerteneceA INTO @per FROM TempTabla WHERE id = @id;
        SET  @id = @per;
        
		  ELSE 
       
		
       
		  SET @ingresar=FALSE;
        END if;
      
          
    END WHILE;
    
    
      INSERT INTO TempTabla
        SELECT 
            dep.id,
            dep.Nombre,
            td.Descripcion,
            dep.PerteneceA
        FROM TiCentral.Dependencias dep
        INNER JOIN TiCentral.TipoDependencias td ON dep.IdTipoDependencia = td.Id
        WHERE dep.id=@id;
        
    
    
    
    SELECT * FROM TempTabla;
    DROP TEMPORARY TABLE IF EXISTS TempTabla;
END ;;
DELIMITER ;
