CREATE DEFINER=`root`@`%` PROCEDURE `sp_DesvinculaUsuarioApp`(
	IN `P_IdUsuario` CHAR(36),
	IN `P_IdApp` CHAR(36),
	IN `P_IdUsuarioModificador` CHAR(36)
)
BEGIN

	DECLARE P_NombreTipoUsuario CHAR(36);
	DECLARE Respuesta INT;
    
    IF ((SELECT Tipo.Nombre FROM TipoUsuario AS Tipo,Usuarios AS Usuario WHERE Usuario.Id = P_IdUsuarioModificador and Usuario.IdTipoUsuario=Tipo.Id) = 'User') THEN
		SET Respuesta = 401;
		SELECT Respuesta,'No tiene permisos para desvincular aplicaciones' AS Mensaje;
	ELSE
		IF (SELECT COUNT(*) FROM UsuarioAplicacion WHERE IdApp = P_IdApp AND IdUsuario = P_IdUsuario) = 1 THEN
			DELETE FROM UsuarioAplicacion WHERE IdUsuario = P_IdUsuario AND IdApp = P_IdApp;
           	SET Respuesta = 201;
			SELECT Respuesta,'El usuario fue desvinculado con éxito de la aplicación' AS Mensaje;
		ELSE
            SET Respuesta = 409;
			SELECT Respuesta,'No existe ninguna vinculación del usuario con la aplicación' AS Mensaje;
		END IF;
	END IF;
END ;;
