CREATE DEFINER=`root`@`%` PROCEDURE `sp_DetalleAppUsuario`(
	IN `P_IdUsuario` CHAR(36)
)
BEGIN
	IF((SELECT EstaActivo From Usuarios WHERE Usuarios.Id = P_IdUsuario) = 1) THEN
		IF((SELECT COUNT(*) FROM UsuarioAplicacion WHERE IdUsuario = P_IdUsuario) > 0 ) THEN
			SELECT
			AP.Id IdApp,
			AP.Nombre ,
			AP.Path,
			AP.Descripcion
			FROM Usuarios US
			INNER JOIN UsuarioAplicacion UA ON US.Id = UA.IdUsuario
			INNER JOIN Apps AP ON AP.Id = UA.IdApp WHERE US.Id = P_IdUsuario AND US.EstaActivo = 1 AND AP.Deleted=0 ORDER BY AP.Nombre;
		ELSE 		
			SELECT '401' AS Respuesta,'Tu usuario no tiene aplicaciones vinculadas.' AS Mensaje;
		END IF;
	ELSEIF  
	((SELECT EstaActivo From Usuarios WHERE Usuarios.Id = P_IdUsuario) = 0) THEN
		SELECT '401' AS Respuesta,'El usuario no esta activo.' AS Mensaje;
	END IF;
END ;;
