CREATE DEFINER=`root`@`%` PROCEDURE `sp_DetalleEntidad`(
    IN `ch_IdEntidad` CHAR(36)
)
BEGIN
    -- Variables para retener datos de la entidad
    DECLARE v_NombreEntidad VARCHAR(255);
    DECLARE v_NombreTipoEntidad VARCHAR(255);
    DECLARE v_IdTipoEntidad CHAR(36);
    DECLARE v_NombrePadre VARCHAR(255);
    DECLARE v_IdPadre CHAR(36);
    
    -- Obteniendo los detalles de la entidad
    SELECT 
        e.Nombre, 
        te.Nombre, 
        e.IdTipoEntidad, 
        e.PerteneceA
    INTO 
        v_NombreEntidad, 
        v_NombreTipoEntidad, 
        v_IdTipoEntidad, 
        v_IdPadre
    FROM Entidades e
    LEFT JOIN TipoEntidades te ON e.IdTipoEntidad = te.Id
    WHERE e.Id = ch_IdEntidad;
    
    -- Si la entidad tiene un padre, obtener su nombre
    IF v_IdPadre IS NOT NULL THEN
        SELECT 
            Nombre INTO v_NombrePadre
        FROM Entidades 
        WHERE Id = v_IdPadre;
    END IF;

    -- Retornar los detalles
    SELECT 
        ch_IdEntidad AS IdEntidad,
        v_NombreEntidad AS NombreEntidad,
        v_IdTipoEntidad AS IdTipoEntidad,
        v_NombreTipoEntidad AS NombreTipoEntidad,
        v_IdPadre AS IdEntidadPerteneceA,
        v_NombrePadre AS EntidadPerteneceA;
    
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
