CREATE DEFINER=`root`@`%` PROCEDURE `sp_DetalleUsuarioAplicacion`(
	IN `ch_IdUsuario` CHAR(36),
	IN `ch_IdApp` CHAR(36)
)
proc:BEGIN
	
	SELECT COUNT(*) INTO @ExisteUsuario FROM Usuarios u WHERE u.Id= ch_IdUsuario;
	SELECT COUNT(*) INTO @ExisteAplicacion FROM Apps a WHERE a.Id= ch_IdApp;
	SELECT COUNT(*) INTO @ExisteUsuarioAplicacion FROM UsuarioAplicacion ua WHERE ua.IdUsuario=ch_IdUsuario AND ua.IdApp=ch_IdApp;
	
	IF(@ExisteUsuario!=1)THEN
		SELECT 'Error: Usuario no encontrado' AS Error;
		leave proc;
	END IF;
	
	
	IF(@ExisteAplicacion!=1)THEN
		SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT =  'Error: Aplicacion no encontrado';
		leave proc;
	END IF;
	
	IF(@ExisteUsuarioAplicacion!=1)THEN
		SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT =  'Error: El usuario no esta vinculado a la aplicación';
		leave proc;
	END IF;
	
	SELECT 
	U.Id,
	U.Nombre,
	U.ApellidoPaterno,
	U.ApellidoMaterno,
	U.NombreUsuario,
	U.CorreoElectronico,
	U.Puesto,
	U.CURP,
	U.RFC,
	U.Telefono,
	U.Ext,
	U.Celular,
	U.IdTipoUsuario,
	tpo.Nombre AS TipoUsuario,
	U.EstaActivo,
	U.PuedeFirmar,
	U.UltimoInicioDeSesion,
	U.Deleted,
	ua.IdApp,
	app.Nombre AS Aplicacion,
	ua.IdEntidad,
	ent.Nombre AS Entidad,
	ent.ControlInterno AS ControlInternoEntidad,
	ent.PerteneceA AS IdEntidadPerteneceA,
	pa.Nombre AS EntidadPerteneceA,
	ent.IdTipoEntidad,
	tpoEnt.Nombre AS TipoEntidad
	FROM Usuarios U 
	INNER JOIN TipoUsuario tpo ON tpo.Id = U.IdTipoUsuario
	INNER JOIN UsuarioAplicacion ua ON ua.IdUsuario = U.Id AND ua.IdApp = ch_IdApp
	LEFT JOIN Apps app ON app.Id = ua.IdApp
	LEFT JOIN Entidades ent ON ent.Id = ua.IdEntidad
	LEFT JOIN Entidades pa ON ent.PerteneceA = pa.Id
	LEFT JOIN TipoEntidades tpoEnt ON tpoEnt.Id = ent.IdTipoEntidad

	WHERE U.Id = ch_IdUsuario;
	
END ;;
DELIMITER ;
