CREATE DEFINER=`root`@`%` PROCEDURE `sp_DetalleUsuarioPermisos`(
    IN usuarioID CHAR(36),
    IN menuControlInterno VARCHAR(200))
BEGIN
    -- Consulta para obtener permisos de un usuario específico en un menú determinado
    SELECT
        r.Nombre AS 'Rol',
        r.ControlInterno AS RolControlInterno,
        m.Menu,
        p.Permiso,
        p.ControlInterno AS PermisoControlInterno
    FROM
        Usuarios u
    -- Relaciones con otras tablas
    JOIN UsuarioRol ur ON u.Id = ur.IdUsuario
    JOIN Roles r ON ur.IdRol = r.Id
    JOIN MenuPermisos mp ON r.Id = mp.idRol
    JOIN Menus m ON mp.idMenu = m.Id
    JOIN Permisos p ON mp.idPermiso = p.Id
    -- Condiciones específicas
    WHERE
        u.Id = usuarioID  -- Usuario específico
    AND
        m.ControlInterno = menuControlInterno  -- Usamos ControlInterno para filtrar
    ORDER BY
        r.Nombre;
END ;;
DELIMITER ;
