CREATE DEFINER=`root`@`%` PROCEDURE `sp_EditarEntidad`(
	IN `P_Id` CHAR(36),
	IN `P_IdTitular` CHAR(36),
	IN `P_TipoEntidad` CHAR(36),
	IN `P_IdUsuario` CHAR(36),
	IN `P_PerteneceA` CHAR(36),
	IN `P_Nombre` VARCHAR(200),
	IN `P_Direccion` LONGTEXT,
	IN `P_Telefono` LONGTEXT,
	IN `P_ControlInterno` LONGTEXT,
	IN `P_ClaveSiregob` LONGTEXT
	)
BEGIN

    -- Primero, verifica que el TipoEntidad existe con el Id proporcionado
	IF ((SELECT COUNT(*) FROM Entidades WHERE Id = P_Id) = 1 ) THEN

		-- Actualiza los valores del tipo de entidad
		UPDATE Entidades 
		SET 
		  -- ID´S
			IdTitular = P_IdTitular, 
			IdTipoEntidad = P_TipoEntidad, 
			PerteneceA = P_PerteneceA, 
			ModificadoPor = P_IdUsuario, 
			-- fin ID´S
			Nombre = P_Nombre, 
			Direccion = P_Direccion, 
			Telefono = P_Telefono, 
			ControlInterno = P_ControlInterno, 
			ClaveSiregob = P_ClaveSiregob, 
			UltimaActualizacion = NOW()
		WHERE 
			Id = P_Id;
	
		-- Devuelve los valores actualizados para confirmación
		SELECT Id, Nombre, Direccion FROM Entidades WHERE Id = P_Id;

	ELSE
		SELECT 'Entidad no encontrado' AS ERROR;
	END IF;

END ;;
DELIMITER ;
