CREATE DEFINER=`root`@`%` PROCEDURE `sp_EditarTipoEntidad`(
	IN `P_Id` CHAR(36),
	IN `P_Nombre` VARCHAR(200),
	IN `P_Descripcion` LONGTEXT,
	IN `P_IdUsuario` CHAR(36)
)
BEGIN

    -- Primero, verifica que el TipoEntidad existe con el Id proporcionado
	IF ((SELECT COUNT(*) FROM TipoEntidades WHERE Id = P_Id) = 1 ) THEN

		-- Actualiza los valores del tipo de entidad
		UPDATE TipoEntidades 
		SET 
			Nombre = P_Nombre, 
			Descripcion = P_Descripcion, 
			ModificadoPor = P_IdUsuario, 
			UltimaActualizacion = NOW()
		WHERE 
			Id = P_Id;
	
		-- Devuelve los valores actualizados para confirmación
		SELECT Id, Nombre, Descripcion FROM TipoEntidades WHERE Id = P_Id;

	ELSE
		SELECT 'Tipo entidad no encontrado' AS ERROR;
	END IF;

END ;;
