CREATE DEFINER=`root`@`%` PROCEDURE `sp_EliminarEntidad`(
	IN `ch_IdEntidad` CHAR(36),
	IN `ch_IdUsuario` CHAR(36)
)
BEGIN


		SELECT COUNT(*) INTO @Existe FROM TiCentral.Entidades D WHERE D.Id=ch_IdEntidad;
		IF( @Existe=1)THEN 
			UPDATE 
			TiCentral.Entidades D SET 
			UltimaActualizacion = CURRENT_TIMESTAMP(),
			ModificadoPor = ch_IdUsuario,
			D.Deleted = 1
			WHERE Id = ch_IdEntidad;
		
			SELECT CONCAT('La Entidad ',(SELECT Nombre FROM TiCentral.Entidades WHERE Id=ch_IdEntidad),
			' fue eliminado con exito.') AS Respuesta;
		ELSE
			SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Id invalido.';
		END IF;
		


END ;;
