CREATE DEFINER=`root`@`%` PROCEDURE `sp_GeneraDocumentoSolicitud`(
	IN `P_IdSolicitud` CHAR(36)
)
BEGIN
	SELECT 
	u.Id,
	u.Nombre,
	u.ApellidoPaterno,
	u.ApellidoMaterno,
	u.NombreUsuario,
	u.CorreoElectronico,
	u.Puesto,
	u.PuedeFirmar,
	u.Curp,
	u.Rfc,
	u.Telefono,
	u.Ext,
	u.Celular,
	t.Nombre AS TipoUsuario,
	s.Id AS IdSolicitud, 
	s.DatosAdicionales,
	s.TipoSolicitud,
	CONCAT_WS(' ',trim(uc.Nombre),trim(uc.ApellidoPaterno),trim(uc.ApellidoMaterno)) AS CreadoPor,
	s.FechaDeCreacion,
	c.Comentario, 
	a.Nombre AS App
	FROM TiCentral.Usuarios u,
	 TiCentral.Solicitudes s,
	  TiCentral.Comentarios c,
	   TiCentral.TipoUsuario t,
		 TiCentral.Apps a,
		  TiCentral.Usuarios uc
	WHERE s.Id = P_IdSolicitud 
	AND s.IdUsuario = u.Id 
	AND s.Id = c.IdSolicitud 
	AND u.IdTipoUsuario = t.Id
	AND s.IdApp = a.Id
	AND s.CreadoPor = uc.Id;
END ;;
DELIMITER ;
