CREATE DEFINER=`root`@`%` PROCEDURE `sp_IniciaSesion`(IN `P_Usuario` VARCHAR ( 50 ))
BEGIN

    SET @UserId = ( SELECT Id FROM TiCentral.Usuarios WHERE NombreUsuario = P_Usuario OR CorreoElectronico = P_Usuario );

    IF ( SELECT EstaActivo FROM TiCentral.Usuarios WHERE NombreUsuario = P_Usuario OR CorreoElectronico = P_Usuario ) = 1 THEN

        SELECT
            US.Id,
						US.Contrasena,
            US.NombreUsuario,
            US.CorreoElectronico,
            E.Id AS IdEntidad,
            E.Nombre AS NombreEntidad,
            TE.Nombre AS NombreTipoEntidad,
            GROUP_CONCAT(DISTINCT CONCAT(R.ControlInterno, '@', R.IdApp)) AS RolesControlInterno
        FROM
            TiCentral.Usuarios US 
        LEFT JOIN TiCentral.UsuarioAplicacion UA ON US.Id = UA.IdUsuario
        LEFT JOIN TiCentral.Entidades E ON UA.IdEntidad = E.Id
        LEFT JOIN TiCentral.TipoEntidades TE ON E.IdTipoEntidad = TE.Id
        LEFT JOIN TiCentral.UsuarioRol UR ON US.Id = UR.IdUsuario
        LEFT JOIN TiCentral.Roles R ON UR.IdRol = R.Id
        WHERE
            (US.NombreUsuario = P_Usuario OR US.CorreoElectronico = P_Usuario)
        GROUP BY US.Id;

        CALL sp_DetalleAppUsuario ( @UserId );

    ELSEIF ( SELECT EstaActivo FROM TiCentral.Usuarios WHERE NombreUsuario = P_Usuario OR CorreoElectronico = P_Usuario ) = 0 THEN
        SELECT
            '401' AS Respuesta,
            'El usuario no está activo.' AS Mensaje;

    END IF;

END ;;
DELIMITER ;
