CREATE DEFINER=`root`@`%` PROCEDURE `sp_ListaAppUsuario`( IN `P_Id` CHAR ( 36 ) )
BEGIN
	IF
		( SELECT COUNT(*) FROM TiCentral.UsuarioAplicacion WHERE IdUsuario = P_Id ) >= 1 THEN
		SELECT
			UA.Id,
			AP.Nombre Nombre,
			AP.Id IdApp,
			US.Id IdUsuario,
			US.NombreUsuario,
			AP.Path,
			AP.Descripcion,
			AP.EstaActivo,
			US.CorreoElectronico 
		FROM
			TiCentral.Usuarios US
			INNER JOIN TiCentral.UsuarioAplicacion UA ON US.Id = UA.IdUsuario
			INNER JOIN TiCentral.Apps AP ON AP.Id = UA.IdApp 
		WHERE
			US.Id = P_Id 
			AND AP.Deleted = 0 
		ORDER BY
			AP.Nombre;
		ELSE SELECT
			'401' AS Respuesta,
			'tu usuario no tiene aplicaciones vinculadas.' AS Mensaje;
		
	END IF;

END ;;
