CREATE DEFINER=`root`@`%` PROCEDURE `sp_ListaEntidades`()
BEGIN
    SELECT 
        e.Id,
        e.Nombre,
        e.Direccion,
        e.Telefono,
        te.Id AS IdTipoEntidad,
        te.Nombre AS NombreTipoEntidad,
        e.IdTitular,
        COALESCE(CONCAT(u.Nombre,' ', u.ApellidoPaterno,' ',u.ApellidoMaterno), 'Sin asignar') AS Titular,
        e.PerteneceA AS IdEntidadPerteneceA,
        COALESCE( p.Nombre, 'Sin asignar') AS EntidadPerteneceA,
        -- p.Nombre AS EntidadPerteneceA, -- Obtener el nombre de la entidad a la que pertenece
        e.ControlInterno,
        e.ClaveSiregob,
        e.FechaCreacion,
        e.UltimaActualizacion
    FROM Entidades e
    LEFT JOIN TipoEntidades te ON e.IdTipoEntidad = te.Id
    LEFT JOIN Entidades p ON e.PerteneceA = p.Id -- LEFT JOIN adicional para obtener el nombre
		LEFT JOIN Usuarios u ON e.IdTitular = u.Id
    WHERE e.Deleted = 0 ORDER BY e.Nombre; -- Condición para que no estén eliminados
END ;;
