CREATE DEFINER=`root`@`%` PROCEDURE `sp_ListaUsuarioEntidades`(
    IN `ch_IdUsuario` CHAR(36),
    IN `ch_IdApp` CHAR(36)
)
BEGIN
    DECLARE ExisteUsuario INT DEFAULT 0;
    DECLARE UsuarioActivo INT DEFAULT 0;
    DECLARE UsuarioEliminado INT DEFAULT 0;

    -- Verificando si el usuario existe.
    SELECT COUNT(*) INTO ExisteUsuario 
    FROM Usuarios u 
    WHERE u.Id= ch_IdUsuario;

    -- Verificando si el usuario está activo.
    SELECT COUNT(*) INTO UsuarioActivo 
    FROM Usuarios u 
    WHERE u.Id= ch_IdUsuario AND u.EstaActivo = 1;

    -- Verificando si el usuario fue eliminado.
    SELECT COUNT(*) INTO UsuarioEliminado 
    FROM Usuarios u 
    WHERE u.Id= ch_IdUsuario AND u.Deleted = 1;

    -- Realizamos las validaciones y retornamos mensajes de error según corresponda.
    IF ExisteUsuario != 1 THEN
        SELECT 'Error: Usuario no encontrado' AS Error;
    ELSEIF UsuarioEliminado = 1 THEN
        SELECT 'Error: El usuario ha sido eliminado' AS Error;
    ELSEIF UsuarioActivo != 1 THEN
        SELECT 'Error: El usuario está inactivo' AS Error;
    ELSE
        -- Aquí va tu consulta recursiva
        WITH RECURSIVE CTE AS (
            SELECT 
                e.Id, 
                e.Nombre, 
                e.PerteneceA, 
                te.Nombre AS NombreTipoEntidad,
                0 AS Nivel
            FROM Entidades e
            JOIN UsuarioAplicacion ua ON e.Id = ua.IdEntidad
            JOIN TipoEntidades te ON e.IdTipoEntidad = te.Id
            WHERE ua.IdUsuario = ch_IdUsuario AND ua.IdApp = ch_IdApp
            UNION ALL
            SELECT 
                e2.Id, 
                e2.Nombre, 
                e2.PerteneceA, 
                te2.Nombre AS NombreTipoEntidad,
                c.Nivel + 1
            FROM Entidades e2
            JOIN CTE c ON e2.Id = c.PerteneceA
            JOIN TipoEntidades te2 ON e2.IdTipoEntidad = te2.Id
        )
        SELECT Id, Nombre, NombreTipoEntidad, Nivel FROM CTE;
    END IF;
END ;;
DELIMITER ;
