CREATE DEFINER=`root`@`%` PROCEDURE `sp_ListaUsuarioRolApp`(
	IN `P_IdApp` CHAR(36)
)
BEGIN

	SELECT 
		u.Id, 
		u.Nombre,
		u.ApellidoPaterno,
		u.ApellidoMaterno,
		u.NombreUsuario,
		u.CorreoElectronico,
		u.Puesto,
		u.CURP,
		u.RFC,
		u.Telefono,
		u.Ext,
		u.Celular,
		u.IdTipoUsuario,
		ua.IdEntidad,
		e.Nombre AS Entidad,
		ur.IdRol,
		r.Nombre AS Rol
	FROM  TiCentral.Apps a
		INNER JOIN TiCentral.UsuarioAplicacion ua ON ua.IdApp = a.Id
		INNER JOIN TiCentral.Usuarios u ON ua.IdUsuario = u.Id
		LEFT  JOIN TiCentral.Entidades e ON ua.IdEntidad = e.Id
		LEFT JOIN TiCentral.UsuarioRol ur ON ur.IdUsuario = u.Id
		LEFT JOIN TiCentral.Roles r ON ur.IdRol = r.Id
	WHERE a.Id = P_IdApp GROUP BY u.NombreUsuario;

END ;;
