CREATE DEFINER=`root`@`%` PROCEDURE `sp_ListaUsuariosRol`(
    IN `ch_ControlInterno` CHAR(36),
    IN `ch_IdApp` CHAR(36)
)
BEGIN

    -- Consulta principal.
    SELECT U.Id,  CONCAT(U.Nombre, ' ', U.ApellidoPaterno, ' ', U.ApellidoMaterno) AS Nombre, U.Puesto, TU.Nombre AS TipoUsuario
    FROM Usuarios U
    JOIN UsuarioRol RU ON U.Id = RU.IdUsuario
    JOIN Roles R ON RU.IdRol = R.Id
    JOIN UsuarioAplicacion UA ON U.Id = UA.IdUsuario
    JOIN Apps A ON UA.IdApp = A.Id
		JOIN TipoUsuario TU ON U.IdTipoUsuario = TU.Id
    WHERE R.ControlInterno = ch_ControlInterno AND A.Id = ch_IdApp
    AND U.Deleted = 0;

END ;;
