CREATE DEFINER=`root`@`%` PROCEDURE `sp_ModificaRol`(
	IN `P_IdRol` CHAR(36),
	IN `P_Nombre` VARCHAR(100),
	IN `P_Descripcion` VARCHAR(200),
	IN `P_ControlInterno` VARCHAR(50),
	IN `P_IdApp` CHAR(36),
	IN `P_IdUsuario` CHAR(36)
)
BEGIN

	UPDATE TiCentral.Roles r SET
	r.Nombre = P_Nombre,
	r.Descripcion = P_Descripcion, 
	r.ControlInterno = P_ControlInterno,
	r.UltimaActualizacion = NOW(),
	r.ModificadoPor = P_IdUsuario
	WHERE r.Id = P_IdRol;
	
	IF (ROW_COUNT() = 0) THEN
		SIGNAL SQLSTATE '45000'
    	SET MESSAGE_TEXT = 'No se modificó el registro';
	ELSE
		SELECT "Se modificó el registro" AS Mensaje;
	END IF;
END ;;
